import React from "react";
import { useNavigate } from 'react-router-dom';

const About = () => {

    const history = useNavigate();
    console.log(history);

    return (
        <>

            <h1>this is another about page</h1>
            <button onClick={() => history.navigator.go } ></button>

        </>
    )
}


export default About;
